import React from 'react';
import Post from './components/Post.jsx';
import Post2 from './components/Post2.jsx';
import Menu from './components/Menu.jsx';
import Navbar from './components/Navbar.jsx';

function App() {
	let samplePosts = [];
	for (let index = 0; index < 8; index++) {
		index % 2 === 0
			? samplePosts.push(
					<li key={index}>
						<Post />
					</li>
				)
			: samplePosts.push(
					<li key={index}>
						<Post2 />
					</li>
				);
	}

	return (
		<React.Fragment>
			<Navbar />
			<div className="container ">
				<div className="row-cols-1">
					<ul className="list-unstyled m-auto col-12 col-sm-12 col-md-8 col-lg-8 col-xl-8 col-xxl-8">
						{samplePosts}
					</ul>
					<div className="m-5" />
				</div>
			</div>
			<Menu />
		</React.Fragment>
	);
}

export default App;
